import React from "react";

const Navbar = () => {
    return(
        <div style={{ overflow:'hidden', margin:0, display: "flex", justifyContent:'space-between', alignItems:'center', width:'100%', height:'100px', position:'absolute',backgroundImage:'linear-gradient(#566, transparent)' }}>
            <div style={{ fontFamily:'Quicksand', fontSize:'36px', fontWeight:'400', color:'teal', padding:'0 50px'}}>Khamilah Enjoli Nixon</div>
            <div style={{ fontSize:'24px', fontFamily:'Quicksand',display:'flex', gap:'50px', padding:'0 50px' }}>
                <a href="/digital-portfolio-projects">Home</a>
                <a href="/project">Projects</a>
            </div>
        </div>
    );
}

export default Navbar;
